import React, { useState, useEffect } from 'react';
import Header from './components/Header'
import OurCard from './components/Card'
import { data, IconCount } from './components/data'
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Login from './components/Signin'
import SignUp from './components/SignUp'
import FooterPage from './components/Footer'
import ForgotPass from './components/FrogotPassword'
import Mercedes from './components/Mercedes'
import './components/App.css'



const useStyles = makeStyles((theme) => ({
  paper: {
    height: 140,
    width: 100,

  },

}));

function App() {
  const classes = useStyles();
  const [product, setProduct] = useState({})

  const dataChange = (item) => {
    setProduct({product: item ,onChange:dataChange})
  }
  useEffect(()=>{
    dataChange()
  },[])

  return (
    <>
      <Router>
        <Header />
        <IconCount.Provider value={product}>
          <Route path='/' exact >
            <Grid container justify="center" >
              {data.map((value) => (
                <Grid key={value.id} item >
                  <OurCard className={classes.paper} value={value} />
                </Grid>
              ))}
            </Grid>
          </Route>
          {data.map((item) => (<Route exact path={'/' + item.name}>
            <Mercedes ndata={item.data} onClick={dataChange(item.data)} />
          </Route>
          ))}
        </IconCount.Provider>
        <Route path='/SignIn'>
          <Login />
        </Route>
        <Route path='/SignUp'>
          <SignUp />
        </Route>
        <Route path='/forgotPassword'>
          <ForgotPass />
        </Route>
      </Router>
      <FooterPage />

    </>
  );
}
export default App;
